import React, { useState } from 'react';
import { Container, Row, Col, Table, Button, Form, Card } from 'react-bootstrap';
import { FaEdit, FaTrashAlt, FaSearch } from 'react-icons/fa'; // أيقونات التعديل والحذف
import 'bootstrap/dist/css/bootstrap.min.css';

const Dashboard = () => {
  // بيانات المستخدمين الافتراضية
  const [users, setUsers] = useState([
    { id: 1, name: 'John Doe', email: 'john@example.com' },
    { id: 2, name: 'Jane Smith', email: 'jane@example.com' },
    { id: 3, name: 'Tom Brown', email: 'tom@example.com' },
  ]);
  const [searchTerm, setSearchTerm] = useState('');

  // البحث عن مستخدم
  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value);
  };

  // تصفية المستخدمين بناءً على البحث
  const filteredUsers = users.filter(user =>
    user.name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  // حذف مستخدم
  const handleDelete = (id) => {
    setUsers(users.filter(user => user.id !== id));
  };

  // تحرير مستخدم (ستكون هذه الوظيفة للعرض فقط، ولكن يمكن ربطها بنموذج تحرير فعلي لاحقًا)
  const handleEdit = (id) => {
    alert(`Edit user with ID: ${id}`);
  };

  return (
    <div style={{ backgroundColor: '#f7f7f7', minHeight: '100vh' }}>
      <Container className="d-flex justify-content-center align-items-center" style={{ minHeight: '100vh' }}>
        <Row className="w-100">
          <Col xs={12} sm={8} md={6} lg={10} className="mx-auto">
            <Card className="shadow-sm rounded p-4">
              <Card.Body>
                <h3 className="text-center mb-4">Dashboard</h3>
                {/* مربع البحث */}
                <Form.Group controlId="search" className="mb-4">
                  <Form.Label>Search User</Form.Label>
                  <div className="d-flex">
                    <Form.Control
                      type="text"
                      placeholder="Search by name"
                      value={searchTerm}
                      onChange={handleSearchChange}
                      style={{ width: '80%' }}
                    />
                    <Button variant="outline-primary" className="ms-2">
                      <FaSearch />
                    </Button>
                  </div>
                </Form.Group>

                {/* جدول المستخدمين */}
                <Table striped bordered hover responsive>
                  <thead>
                    <tr>
                      <th>Name</th>
                      <th>Email</th>
                      <th>Actions</th>
                    </tr>
                  </thead>
                  <tbody>
                    {filteredUsers.map(user => (
                      <tr key={user.id}>
                        <td>{user.name}</td>
                        <td>{user.email}</td>
                        <td>
                          <Button
                            variant="warning"
                            className="me-2"
                            onClick={() => handleEdit(user.id)}
                          >
                            <FaEdit /> Edit
                          </Button>
                          <Button
                            variant="danger"
                            onClick={() => handleDelete(user.id)}
                          >
                            <FaTrashAlt /> Delete
                          </Button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </Table>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Dashboard;
